// Import the required modules into your "server.js" file:
const express = require('express'); // Express.js framework for building web applications
const bodyParser = require('body-parser'); // Middleware for parsing request bodies
const multer = require('multer'); // Middleware for handling multipart/form-data requests (file uploads)
const sharp = require('sharp'); // Sharp library for image processing

// Create an instance of the Express app
const app = express();

// Use the "body-parser" middleware to parse the request body
app.use(bodyParser.urlencoded({ extended: true }));
app.use(bodyParser.json());

// Define the storage engine for Multer (where uploaded files will be stored)
const storage = multer.diskStorage({
  destination: './uploads', // Folder where uploaded files will be stored
  filename: (req, file, cb) => {
    // Use the original filename for the uploaded file
    cb(null, file.originalname);
  }
});

// Create a Multer instance with the defined storage engine
const upload = multer({ storage });

// Define the "GET" route for serving the "index.html" file
app.get('/', (req, res) => {
  // Send the "index.html" file as the response
  res.sendFile(__dirname + '/index.html');
});

// Define the "POST" route for handling the image upload
app.post('/upload', upload.single('file'), (req, res) => {
  // Get the uploaded file from the request object
  const { file } = req;

  // Get the original filename and buffer of the uploaded file
  const { originalname, buffer } = file;

  // Use Sharp to resize the image to a specified width and height (500x500 in this example)
  sharp(buffer)
    .resize({ width: 500, height: 500 })
    .toFormat('jpeg') // Convert the image to JPEG format
    .toFile(`./uploads/${originalname}`); // Save the resized image to disk

  // Send a success message as the response
  res.send(`The image ${originalname} has been resized and saved to ./uploads/`);
});

// Start the server and listen on port 3000 (or a custom port defined in the environment variables)
const PORT = process.env.PORT || 3000;
app.listen(PORT, () => {
  console.log(`Server running on port ${PORT}`);
});
