/**
 * This function splits a given string into substrings based on a list of separators.
 * It also provides information about the matched separator and its position in the input string.
 *
 * @param str The input string to be split.
 * @param separators A list of separators to split the string by.
 * @return A formatted string containing the split substrings and separator information.
 */
string Multisplit(const string& str, const vector<string>& separators) {
    // Initialize an output vector to store the result
    vector<string> result;

    // Initialize a variable to keep track of the current separator index
    int separator_index = 0;

    // Initialize a stack to store the delimiter indices
    vector<int> delimiter_stack;

    // Loop through each character in the input string
    for (int i = 0; i < str.size(); ++i) {
        // Check if the current character matches any of the separators
        for (int j = separator_index; j < separators.size(); ++j) {
            // If a match is found, update the separator index and push the delimiter index to the stack
            if (str.substr(i, separators[j].size()) == separators[j]) {
                delimiter_stack.push_back(j);
                separator_index = j + 1;
                break;
            }
        }

        // If no separator is found, add the current substring to the result and continue
        if (j >= separators.size()) {
            // Add the current character to the last substring in the result
            if (!result.empty()) {
                result.back() += str[i];
            } else {
                result.push_back(string(1, str[i]));
            }
            continue;
        }

        // Add the matched separator information to the result
        if (!result.empty()) {
            result.back() += " (" + separators[j] + ") at position " + to_string(i);
        } else {
            result.push_back("(" + separators[j] + ") at position " + to_string(i));
        }
    }

    // Pop the delimiter stack and append matching substrings to the result
    for (int i = delimiter_stack.size() - 1; i >= 0; --i) {
        int delimiter_index = delimiter_stack[i];
        if (i > 0) {
            result[delimiter_stack[i - 1]] += " (" + separators[delimiter_index] + ") at position " + to_string(delimiter_stack[i]);
        }
    }

    // Format the result as specified and return
    string formatted_result = "";
    for (const string& s : result) {
        formatted_result += s + " ";
    }
    return formatted_result;
}

int main() {
    string str = "a!===b=!=c";
    vector<string> separators = {"==", "!=", "="};

    string result = Multisplit(str, separators);

    // Expected output: "a" (!=) "" (==) "b" (=) "" (!=) "c"
    cout << result << endl;

